window.bookSummaryJSON = "<p>A paranormal agency in tatters. A critical alliance that must not fail. A betrayal in their darkest hour.</p> <p>The demon Ekhmez ripped out the heart of America’s supernatural defenders and strengthened their foes. The agencies of the Omicron branch of the US government face a newly expanded threat with their resources stretched to the breaking point.</p> <p>To hold the line, newly promoted Commander David White of ONSET is sent to forge an alliance with the Elfin Conclave, a supernatural organization with its own history, grudges, and politics.</p> <p>When violence wracks the Conclave and guts the allies they sought, David White must hunt the Elfin’s foes across the Pacific Northwest, taking any help that comes his way - because when the world is on fire, can you turn away your enemy’s enemy?</p>"; 
